return {
{ label = 'hx-post', insertText = 'hx-post="$1"$0', filterText = 'hx-post', documentation = 'The `hx-post` attribute will cause an element to issue a `POST` to the specified URL and swap\\nthe HTML into the DOM using a swap strategy:', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-history', insertText = 'hx-history="$1"$0', filterText = 'hx-history', documentation = 'Set the `hx-history` attribute to `false` on any element in the current document, or any html fragment loaded into the current document by htmx, to prevent sensitive data being saved to the localStorage cache when htmx takes a snapshot of the page state. ', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-trigger', insertText = 'hx-trigger="$1"$0', filterText = 'hx-trigger', documentation = 'The `hx-trigger` attribute allows you to specify what triggers an AJAX request.  A trigger\\nvalue can be one of the following:', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-vars', insertText = 'hx-vars="$1"$0', filterText = 'hx-vars', documentation = '**NOTE: `hx-vars` has been deprecated in favor of [`hx-vals`](@/attributes/hx-vals.md), which is safer by default.**', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-sse', insertText = 'hx-sse="$1"$0', filterText = 'hx-sse', documentation = '*Note: This attribute will be migrated to an extension in htmx 2.0, which is available now.  Please visit the\\n[SSE extension page](@/extensions/server-sent-events.md) to learn about the new implementation of SSE as an extension.*', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-confirm', insertText = 'hx-confirm="$1"$0', filterText = 'hx-confirm', documentation = 'The `hx-confirm` attribute allows you to confirm an action before issuing a request.  This can be useful\\nin cases where the action is destructive and you want to ensure that the user really wants to do it.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-sync', insertText = 'hx-sync="$1"$0', filterText = 'hx-sync', documentation = 'The `hx-sync` attribute allows you to synchronize AJAX requests between multiple elements.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-disinherit', insertText = 'hx-disinherit="$1"$0', filterText = 'hx-disinherit', documentation = 'The default behavior for htmx is to "inherit" many attributes automatically: that is, an attribute such as\\n[hx-target](@/attributes/hx-target.md) may be placed on a parent element, and all child elements will inherit\\nthat target.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-encoding', insertText = 'hx-encoding="$1"$0', filterText = 'hx-encoding', documentation = 'The `hx-encoding` attribute allows you to switch the request encoding from the usual `application/x-www-form-urlencoded`\\nencoding to `multipart/form-data`, usually to support file uploads in an ajax request.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-params', insertText = 'hx-params="$1"$0', filterText = 'hx-params', documentation = 'The `hx-params` attribute allows you to filter the parameters that will be submitted with an AJAX request.  ', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-headers', insertText = 'hx-headers="$1"$0', filterText = 'hx-headers', documentation = 'The `hx-headers` attribute allows you to add to the headers that will be submitted with an AJAX request.  ', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-delete', insertText = 'hx-delete="$1"$0', filterText = 'hx-delete', documentation = 'The `hx-delete` attribute will cause an element to issue a `DELETE` to the specified URL and swap\\nthe HTML into the DOM using a swap strategy:', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-history-elt', insertText = 'hx-history-elt="$1"$0', filterText = 'hx-history-elt', documentation = 'The `hx-history-elt` attribute allows you to specify the element that will be used to snapshot and\\nrestore page state during navigation.  By default, the `body` tag is used.  This is typically\\ngood enough for most setups, but you may want to narrow it down to a child element.  Just make\\nsure that the element is always visible in your application, or htmx will not be able to restore\\nhistory navigation properly.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-on', insertText = 'hx-on="$1"$0', filterText = 'hx-on', documentation = 'The `hx-on` attribute allows you to embed scripts inline to respond to events directly on an element; similar to the [`onevent` properties](https://developer.mozilla.org/en-US/docs/Web/Events/Event_handlers#using_onevent_properties) found in HTML, such as `onClick`.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-swap', insertText = 'hx-swap="$1"$0', filterText = 'hx-swap', documentation = 'The `hx-swap` attribute allows you to specify how the response will be swapped in relative to the\\n[target](@/attributes/hx-target.md) of an AJAX request.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-include', insertText = 'hx-include="$1"$0', filterText = 'hx-include', documentation = 'The `hx-include` attribute allows you to include additional element values in an AJAX request.  The value of\\n this attribute is a CSS query selector of the element or elements to include in the query.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-disable', insertText = 'hx-disable="$1"$0', filterText = 'hx-disable', documentation = 'The `hx-disable` attribute will disable htmx processing for a given element and all its children.  This can be \\nuseful as a backup for HTML escaping, when you include user generated content in your site, and you want to \\nprevent malicious scripting attacks.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-replace-url', insertText = 'hx-replace-url="$1"$0', filterText = 'hx-replace-url', documentation = 'The `hx-replace-url` attribute allows you to replace the current url of the browser [location history](https://developer.mozilla.org/en-US/docs/Web/API/History_API).', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-put', insertText = 'hx-put="$1"$0', filterText = 'hx-put', documentation = 'The `hx-put` attribute will cause an element to issue a `PUT` to the specified URL and swap\\nthe HTML into the DOM using a swap strategy:', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-push-url', insertText = 'hx-push-url="$1"$0', filterText = 'hx-push-url', documentation = 'The `hx-push-url` attribute allows you to push a URL into the browser [location history](https://developer.mozilla.org/en-US/docs/Web/API/History_API).\\nThis creates a new history entry, allowing navigation with the browserâ€™s back and forward buttons.\\nhtmx snapshots the current DOM and saves it into its history cache, and restores from this cache on navigation.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-indicator', insertText = 'hx-indicator="$1"$0', filterText = 'hx-indicator', documentation = 'The `hx-indicator` attribute allows you to specify the element that will have the `htmx-request` class\\nadded to it for the duration of the request. This can be used to show spinners or progress indicators\\nwhile the request is in flight.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-target', insertText = 'hx-target="$1"$0', filterText = 'hx-target', documentation = 'The `hx-target` attribute allows you to target a different element for swapping than the one issuing the AJAX\\nrequest.  The value of this attribute can be:', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-ws', insertText = 'hx-ws="$1"$0', filterText = 'hx-ws', documentation = '*Note: This attribute will be migrated to an extension in htmx 2.0, which is available now.  Please visit the \\n[WebSockets extension page](@/extensions/web-sockets.md) to learn about the new implementation of Web Sockets as an extension.*', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-ext', insertText = 'hx-ext="$1"$0', filterText = 'hx-ext', documentation = 'The `hx-ext` attribute enables an htmx [extension](@/extensions/_index.md) for an element and all its children.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-get', insertText = 'hx-get="$1"$0', filterText = 'hx-get', documentation = 'The `hx-get` attribute will cause an element to issue a `GET` to the specified URL and swap\\nthe HTML into the DOM using a swap strategy:', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-boost', insertText = 'hx-boost="$1"$0', filterText = 'hx-boost', documentation = 'The `hx-boost` attribute allows you to "boost" normal anchors and form tags to use AJAX instead.  This\\nhas the [nice fallback](https://en.wikipedia.org/wiki/Progressive_enhancement) that, if the user does not \\nhave javascript enabled, the site will continue to work.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-request', insertText = 'hx-request="$1"$0', filterText = 'hx-request', documentation = 'The `hx-request` attribute allows you to configure various aspects of the request via the following attributes:\\n \\n* `timeout` - the timeout for the request, in milliseconds\\n* `credentials` - if the request will send credentials\\n* `noHeaders` - strips all headers from the request', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-select-oob', insertText = 'hx-select-oob="$1"$0', filterText = 'hx-select-oob', documentation = 'The `hx-select-oob` attribute allows you to select content from a response to be swapped in via an out-of-band swap.  \\nThe value of this attribute is comma separated list of elements to be swapped out of band.  This attribute is almost\\nalways paired with [hx-select](@/attributes/hx-select.md).', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-validate', insertText = 'hx-validate="$1"$0', filterText = 'hx-validate', documentation = 'The `hx-validate` attribute will cause an element to validate itself by way of the [HTML5 Validation API](@/docs.md#validation)\\nbefore it submits a request.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-vals', insertText = 'hx-vals="$1"$0', filterText = 'hx-vals', documentation = 'The `hx-vals` attribute allows you to add to the parameters that will be submitted with an AJAX request.  ', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-patch', insertText = 'hx-patch="$1"$0', filterText = 'hx-patch', documentation = 'The `hx-patch` attribute will cause an element to issue a `PATCH` to the specified URL and swap\\nthe HTML into the DOM using a swap strategy:', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-preserve', insertText = 'hx-preserve="$1"$0', filterText = 'hx-preserve', documentation = 'The `hx-preserve` attribute allows you to keep an element unchanged during HTML replacement.\\nElements with `hx-preserve` set are preserved by `id` when htmx updates any ancestor element.\\nYou *must* set an unchanging `id` on elements for `hx-preserve` to work.\\nThe response requires an element with the same `id`, but its type and other attributes are ignored.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-select', insertText = 'hx-select="$1"$0', filterText = 'hx-select', documentation = 'The `hx-select` attribute allows you to select the content you want swapped from a response.  The value of\\nthis attribute is a CSS query selector of the element or elements to select from the response.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-swap-oob', insertText = 'hx-swap-oob="$1"$0', filterText = 'hx-swap-oob', documentation = 'The `hx-swap-oob` attribute allows you to specify that some content in a response should be \\nswapped into the DOM somewhere other than the target, that is "Out of Band".  This allows you to piggy back updates to other element updates on a response.', insertTextFormat = 2, kind = 12 },
	{ label = 'hx-prompt', insertText = 'hx-prompt="$1"$0', filterText = 'hx-prompt', documentation = 'The `hx-prompt` attribute allows you to show a prompt before issuing a request.  The value of\\nthe prompt will be included in the request in the `HX-Prompt` header.', insertTextFormat = 2, kind = 12 }
}
